import React, { useState, useEffect } from "react";
import { BASE_URL } from "../../../constants/API";


export default function CardList() {

  useEffect(() => {
  fetch(BASE_URL)
      .then(response => response.json())
      .then(json => console.log(json))
      .catch(error => console.log(error));
}, []);

    return null;
}
